var Helpers = (function(){

  function isInViewport($el){
    var elementTop = $el.offset().top;
    var elementBottom = elementTop + $el.outerHeight();
    var viewportTop = $(window).scrollTop();
    // If fixed navbar
    if ($('.js--navbar-blueberry.fixed-top').length){
      viewportTop += $('.js--navbar-blueberry.fixed-top').outerHeight();
    }
    var viewportBottom = viewportTop + $(window).height();
    return elementBottom > viewportTop && elementTop < viewportBottom;
  }

  function getViewportSize(){
    return {
      width: Math.max(document.documentElement.clientWidth, window.innerWidth || 0),
      height: Math.max(document.documentElement.clientHeight, window.innerHeight || 0)
    };
  }

  return {
    isInViewport: isInViewport,
    getViewportSize: getViewportSize
  };
})();

var NotificationCenter = (function(){
  function makeHtml(type, text){
    return '<p class="type">' + type.toUpperCase() + '</p><p>' + text + '</p>';
  }

  function notify(type, text) {
    new Noty({
      type: type,
      text: makeHtml(type, text),
      layout: 'responsive',
      theme: 'custom',
      timeout: 5000,
      animation: {
        open: 'animated fadeInUp', // Animate.css class names
        close: 'animated fadeOutUp' // Animate.css class names
      }
    }).show();
  }

  return {
    notify: notify
  };
})();

// Fixes Navbar for vieport width less than a set threshold

var NavbarFixer = (function(){
  var DOM = {};
  var options = {};
  var fixed = false;
  var height;

  function _cacheDom(element) {
    DOM.$navbar = $(element);
    DOM.$navbarToggler = DOM.$navbar.find('.navbar-toggler');
    DOM.$navbarCollapse = DOM.$navbar.find('.navbar-collapse');
  }

  function _bindEvents(element) {
    $(window).resize(function(){
      _checkNavbarHeight();
      _fixReleaseNavbar();
    });
    DOM.$navbar.on('click', '.nav-link', function(){
      _collapseNavbar();
    });
  }

  function _fixReleaseNavbar(){
    if (_checkNeedsFixed()){
      DOM.$navbar.addClass('fixed-top');
      $('body').css('padding-top', getNavbarHeight() + 'px');
      fixed = true;
    } else {
      DOM.$navbar.removeClass('fixed-top');
      $('body').css('padding-top', 0);
      fixed = false;
    }
  }

  function _checkNavbarHeight(){
    _collapseNavbar();
    if (!DOM.$navbarCollapse.hasClass('show')){
      height = DOM.$navbar.outerHeight();
    }
  }

  function _collapseNavbar(){
    if (DOM.$navbarCollapse.hasClass('show')){
      DOM.$navbarToggler.click();
    }
  }

  function _checkNeedsFixed(){
    if (Helpers.getViewportSize().width < options.maxFixedWidth){
      return true;
    }
    return false;
  }

  function _render(){
    _checkNavbarHeight();
    _fixReleaseNavbar();
  }

  function init(element) {
    if (element) {
      options = $.extend(options, $(element).data());
      _cacheDom(element);
      _bindEvents();
      _render();
    }
  }

  function isFixed(){
    return fixed;
  }

  function getNavbarHeight(){
    return height;
  }


  return {
    init: init,
    isFixed: isFixed,
    getNavbarHeight: getNavbarHeight
  };
})();

// Sticks element in viewport for screen width larger than provided

